#[derive(Debug, PartialEq)]
pub enum CoinJoinCoordinator {
    Wasabi,
    Samourai,
    Unknown,
}

/// Returns features of a transaction that help in determining whether it
/// could be a CoinJoin transaction.
fn coinjoin_features(tx: &bitcoin::Transaction) -> (usize, usize, (u64, usize)) {
    (
        tx.input.len(),
        tx.output.len(),
        tx.output
            .clone()
            .into_iter()
            .map(|out| out.value)
            .collect::<counter::Counter<_>>()
            .most_common()[0],
    )
}

pub fn coordinator(tx: &bitcoin::Transaction) -> CoinJoinCoordinator {
    let (input_count, output_count, (mcv, mcv_count)) = coinjoin_features(tx);

    // most clearly defined: Samourai Whirlpool
    if input_count == 5 && output_count == 5 && [5_000_000, 10_000_000, 50_000_000].contains(&mcv) {
        return CoinJoinCoordinator::Samourai;
    }

    // Wasabi
    let min_wasabi_participants = 20;
    if mcv_count >= min_wasabi_participants
        && output_count >= 2 * min_wasabi_participants
        && 8_000_000 < mcv
        && mcv < 12_000_000
    {
        return CoinJoinCoordinator::Wasabi;
    }

    return CoinJoinCoordinator::Unknown;
}

#[cfg(test)]
mod tests {
    use super::*;
    use bitcoin::consensus::encode::deserialize;

    #[test]
    fn test_real_samourai() {
        // 4c2bf8d0379bcfc301603717dc61dbe348b2516bddb908df01ae512bb6d40f16
        let tx = deserialize(&hex::decode("").unwrap()[..]).unwrap();
        assert_eq!(coordinator(&tx), CoinJoinCoordinator::Samourai);
    }

    #[test]
    fn test_real_wasabi() {
        // 19646d922fca705efee55f61bf4b2041e0077498f694d8e177e992729bda960a
        let tx = deserialize(&hex::decode("").unwrap()[..]).unwrap();
        assert_eq!(coordinator(&tx), CoinJoinCoordinator::Wasabi);
    }
}
